import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Routes, Route, Navigate, Link, useLocation } from 'react-router-dom';
import LoginForm from './components/Login.js';
import Website from './components/Website/Website.js';
import NewsPreferences from './components/NewsPreferences';
import RegistrationForm from './components/RegistrationForm.js';
import UserProfile from './components/Profile.js';
import userIcon from './components/images/user.svg';
import Chatbot from './components/Chatbot/Chatbot.js';

import './App.css';

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [selectedtags, setSelectedtags] = useState([]);
  const [articles, setArticles] = useState([]);

  // Using a custom hook to access query parameters
  const useQuery = () => {
    const location = useLocation();
    return new URLSearchParams(useLocation().search);
  }

  const query = useQuery();

  useEffect(() => {
    handleLogin();
  }, []);

  const handleLogin = () => {
    const queryParams = new URLSearchParams(window.location.search);
    const hasAllParams = ['id', 'location', 'age', 'gender', 'education', 'condition']
      .every(param => queryParams.has(param));

    if (hasAllParams) {
      setIsLoggedIn(true);
    } else {
      console.error('Missing required URL parameters.');
    }
  };

  const handlePreferencesSubmit = (tags) => {
    // Existing code
  };

  // Redirect based on condition parameter
  const renderRedirect = () => {
    const condition = query.get('condition');
    if (condition === 'condition1') {
      return <Navigate to="/chatbot" replace />;
    } else if (condition === 'condition2') {
      return <Navigate to="/website" replace />;
    } else {
      return <NewsPreferences onPreferencesSubmit={handlePreferencesSubmit} />;
    }
  }

  return (
    <Router>
      <div className="App">
        {isLoggedIn && (
          <header className='header'>
            <nav className='nav'>
              <ul>
                <li className='home'><Link to="/">Home</Link></li>
                {query.get('condition') !== 'condition1' && <li className='website'><Link to="/website">Website</Link></li>}
                {query.get('condition') !== 'condition2' && <li className='chatbot'><Link to="/chatbot">Chatbot</Link></li>}
                <li className='profile'><Link to="/profile"><img src={userIcon} alt="User Icon" /></Link></li>
              </ul>
            </nav>
          </header>
        )}
        <Routes>
          <Route path="/register" element={<RegistrationForm />} />
          <Route path="/news-preferences" element={<NewsPreferences onPreferencesSubmit={handlePreferencesSubmit} />} />
          <Route path="/website" element={<Website selectedtags={selectedtags} articles={articles} />} />
          <Route path="/chatbot" element={<Chatbot selectedtags={selectedtags} articles={articles} />} />
          <Route path="/" element={isLoggedIn ? renderRedirect() : <Navigate to="/login" replace />} />
          <Route path="/profile" element={<UserProfile />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
